POSITIONS = ["PON", "OPO", "CEN", "LEV", "LIB"]

def create_player(player_data):
    payload = {
        "name": player_data["name"],
        "photo": player_data["photo"]
    }
    try:
        response = requests.post(f"{BASE_URL}/player", json=payload)
        response.raise_for_status()
        data = response.json()
        print(f"Player created: {data['name']} (ID: {data['_id']})")
        return data['_id']
    except requests.exceptions.RequestException as e:
        print(f"Error creating player {player_data['name']}: {e}")
        return None

def create_sport():
    try:
        response = requests.post(f"{BASE_URL}/sport", json=SPORT_DATA)
        response.raise_for_status()
        data = response.json()
        print(f"Sport created: {data['name']} (ID: {data['_id']})")
        return data['_id']
    except requests.exceptions.RequestException as e:
        print(f"Error creating sport: {e}")
        # Tentar buscar se j√° existe (opcional, mas bom para re-execu√ß√£o)
        # Aqui assumimos cria√ß√£o nova para simplificar
        return None

def create_card(player_id, sport_id):
    # Gera atributos aleat√≥rios
    attributes = {
        "atk": random.randint(50, 95),
        "blo": random.randint(50, 95),
        "sac": random.randint(50, 95),
        "def": random.randint(50, 95),
        "lev": random.randint(50, 95),
        "fis": random.randint(50, 95)
    }
    
    # Calcula overall simples (m√©dia)
    overall = sum(attributes.values()) // len(attributes)
    
    position = random.choice(POSITIONS)

    payload = {
        "player": player_id,
        "sport": sport_id,
        "position": position,
        "attributes": attributes,
        "overall": overall
    }

    try:
        response = requests.post(f"{BASE_URL}/card", json=payload)
        response.raise_for_status()
        data = response.json()
        print(f"Card created for player {player_id}: {position} - OVR {overall}")
    except requests.exceptions.RequestException as e:
        print(f"Error creating card: {e}")

def main():
    print("Starting database population...")
    
    # 1. Create Players
    player_ids = []
    for player in PLAYERS:
        pid = create_player(player)
        if pid:
            player_ids.append(pid)
            
    if not player_ids:
        print("No players created. Exiting.")
        return

    # 2. Create Sport
    sport_id = create_sport()
    if not sport_id:
        print("Failed to create sport. Exiting.")
        return

    # 3. Create Cards
    for pid in player_ids:
        create_card(pid, sport_id)

    print("Done!")

if __name__ == "__main__":
    main()
